import React from "react"
import ReactDOM from "react-dom"
import "./styles.css"

const App = () => {
    return(
        <div className="App">
            Hello Word
        </div>
    )
}

const rootElement = document.getElementById("root")
ReactDOM.render(<App />, rootElement)
